import React from 'react'

// const key = 'b4a1e8d25cdbd70b76c1c854d2204b32'


export default class Weather2 extends React.Component {

    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div>
                <h2 className='weather-info'>The city is: <span className='weather-value'>{this.props.city}</span></h2>
                <h2 className='weather-info'>The temp is: <span className='weather-value'>{this.props.temp}</span></h2>
                <h2 className='weather-info'>The wind speed is: <span className='weather-value'>{this.props.wind}</span></h2>
            </div>
        )
    }
}
